module.exports = JSON.parse('[{"id":1,"name":"Μαρία Παπαδοπούλου","rating":5,"quote":"Η κόρη μου Σοφία μαθαίνει Αγγλικά στο Level Up εδώ και έξι μήνες και η πρόοδός της είναι καταπληκτική! Οι καθηγητές είναι τόσο υπομονετικοί και κάνουν το μάθημα διασκεδαστικό. Ανυπομονεί πραγματικά για τα μαθήματά της κάθε εβδομάδα.","thumbnail":"/images/testimonial/home1/1.png"},{"id":2,"name":"Δημήτρης Κώστας","rating":5,"quote":"Το Level Up βοήθησε τον γιο μου Νίκο να προετοιμαστεί για τις εξετάσεις πιστοποίησης Γερμανικών. Τα μικρά τμήματα σημαίνουν ότι παίρνει προσωπική προσοχή, και η αυτοπεποίθησή του στο να μιλάει Γερμανικά έχει αυξηθεί τρομερά. Το συστήνω ανεπιφύλακτα!","thumbnail":"/images/testimonial/home1/2.png"},{"id":3,"name":"Άννα Νικολαΐδου","rating":5,"quote":"Επιλέξαμε το Level Up για τα δίδυμά μας και δεν θα μπορούσαμε να είμαστε πιο ευχαριστημένοι. Η εξατομικευμένη προσέγγιση λειτουργεί πραγματικά - κάθε παιδί μαθαίνει με τον δικό του ρυθμό. Οι καθηγητές καταλαβαίνουν ότι κάθε μαθητής είναι διαφορετικός και προσαρμόζονται αναλόγως.","thumbnail":"/images/testimonial/home1/3.png"},{"id":4,"name":"Γιώργος Σταύρου","rating":4,"quote":"Η κόρη μου ξεκίνησε ως εντελώς αρχάρια στα Αγγλικά και τώρα μιλάει με αυτοπεποίθηση με τους διεθνείς φίλους της στο διαδίκτυο. Οι διαδραστικές μέθοδοι στο Level Up κάνουν όλη τη διαφορά. Σας ευχαριστούμε που πιστέψατε σε αυτήν!","thumbnail":"/images/testimonial/home1/4.png"},{"id":5,"name":"Ελένη Χρήστου","rating":5,"quote":"Το Level Up είναι περισσότερο από ένα φροντιστήριο ξένων γλωσσών - είναι ένας χώρος όπου ο γιος μου Αλέξανδρος ανακάλυψε την αγάπη του για τη μάθηση. Το ζεστό, ενθαρρυντικό περιβάλλον ενίσχυσε όχι μόνο τις δεξιότητές του στα Αγγλικά αλλά και τη συνολική του αυτοπεποίθηση.","thumbnail":"/images/testimonial/home1/5.png"}]');

